import { createRouter, createWebHistory } from 'vue-router';
import HomeView from '../views/HomeView.vue';
import StudyGroups from '../views/StudyGroups.vue';
import StudyGroup from '../views/StudyGroup.vue';
import LoginView from '../views/LoginView.vue';
import RegisterView from '../views/RegisterView.vue';
import CreateStudyGroup from '../components/CreateStudyGroup.vue';
import JoinStudyGroup from '../components/JoinStudyGroup.vue';
import DiscussionBoard from '../components/DiscussionBoard.vue';
import ResourceShare from '../components/ResourceShare.vue';

const routes = [
  { path: '/', name: 'Home', component: HomeView },
  { path: '/study-groups', name: 'StudyGroups', component: StudyGroups },
  {
    path: '/study-group/:id',
    name: 'StudyGroup',
    component: StudyGroup,
    children: [
      { path: 'discussion-board', component: DiscussionBoard },
      { path: 'resource-share', component: ResourceShare },
    ],
  },
  { path: '/login', name: 'Login', component: LoginView },
  { path: '/register', name: 'Register', component: RegisterView },
  {
    path: '/create-study-group',
    name: 'CreateStudyGroup',
    component: CreateStudyGroup,
  },
  {
    path: '/join-study-group',
    name: 'JoinStudyGroup',
    component: JoinStudyGroup,
  },
];

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes,
});

export default router;
